tables.table_schema:
CREATE TABLE waste_management_customers (
    customer_id INT PRIMARY KEY,
    customer_name VARCHAR(50),
    feedback TEXT
);

CREATE TABLE waste_management_services (
    service_id INT PRIMARY KEY,
    service_name VARCHAR(50),
    service_description TEXT,
    service_rating FLOAT
);

CREATE TABLE waste_management_services (customer_id INT PRIMARY KEY,
feedback TEXT,
service_rating INT,
service_date DATE
);

CREATE TABLE service_quality_analysis (analysis_id INT PRIMARY KEY,
service_rating INT,
satisfaction_level INT,
feedback_analysis TEXT
);

CREATE TABLE customer_details (customer_id INT PRIMARY KEY,
customer_name VARCHAR(50),
customer_email VARCHAR(50),
customer_phone VARCHAR(15)
);
